MGCAddSnippet(1, "Title Page");
MGCAddSnippet(2, "List of Figures");
MGCAddSnippet(3, "List of Tables");
MGCAddSnippet(4, "");
MGCAddSnippet(5, "This manual contains Calibre solutions to common IC physical verification problems from a broad spectrum of topics.");
MGCAddSnippet(6, "The licenses required to perform the procedures discussed in this manual include Calibre Interactive, CalibrenmDRC/Calibre nmDRC-H, Calibre nmLVS/Calibre nmLVS-H, Calibre PERC, CalibreRVE, and Calibre YieldServer.");
MGCAddSnippet(7, "The command descriptions use font properties and several metacharacters to document the command syntax.");
MGCAddSnippet(8, "Advanced DRC solutions use DFM properties to classify shapes in the design. Many of the solutions use equation-based DRC (eqDRC), which is a set of SVRF statements that extend the capabilities of Calibre nmDRC. Using eqDRC, you can analyze complex interactions that are difficult or impossible to verify using traditional DRC methods. The eqDRC toolset includes the ability to manipulate DFM properties, and to write complex equations using DFM Expressions. ");
MGCAddSnippet(9, "This section presents various contact and via checks.");
MGCAddSnippet(10, "You can use a multilayer DFM Property operation to return the number of contacts in each source-drain region and each gate region.");
MGCAddSnippet(11, "You can check that the contacts in the source-drain regions on both sides of a gate are in balance. ");
MGCAddSnippet(12, "You can quantify current crowding through a gate based on the run length of contacts on each side of the gate and identify gates that have the worst current crowding effects.");
MGCAddSnippet(13, "You can check for current crowding effects based on the number of contacts and their positions in the source and drain regions.");
MGCAddSnippet(14, "You can identify metal overlap regions that contain fewer vias than the maximum number of vias possible based on the specified enclosure, width, and space constraints. You can also determine if the vias have the expected total area. ");
MGCAddSnippet(15, "This section includes checks related to routing layers and devices.");
MGCAddSnippet(16, "You can use marker layers to identify and check device orientation. This rule checks that all devices within the same marker layer shape have the same orientation. ");
MGCAddSnippet(17, "You can identify via transitions that have an insufficient number of redundant vias to handle the current for the total gate width being driven by a particular metal line. You can do this by writing a rule check that verifies there is at least one via per unit gate width.");
MGCAddSnippet(18, "This example uses DFM Property CONNECTED to identify via transitions that do not have enough redundant vias to handle the current for the total gate width being driven by a particular metal line.");
MGCAddSnippet(19, "This example uses Expand Edge and DFM Property NODAL to identify via transitions that have an insufficient number of redundant vias to handle the current for the total gate width being driven by a particular metal line.");
MGCAddSnippet(20, "This example uses DFM Stamp and DFM Property NODAL to identify via transitions that have an insufficient number of redundant vias to handle the current for the total gate width being driven by a particular metal line.");
MGCAddSnippet(21, "Wide metal spacing refers to a layout challenge where wide metal paths separated by small areas of silicon dioxide can lead to performance and yield problems. Since metal is softer than oxide, it is removed more easily during traditional Chemical Mechanical Polishing (CMP) processes,6 and can lead to the erosion effects.");
MGCAddSnippet(22, "Commonly, addressing wide metal spacing checks involves a series of single-dimensional design rules. A minimum space value is associated with each range of widths for a single band and both bands.");
MGCAddSnippet(23, "You can write a wide metal spacing check by implementing a continuous function in terms of the width and space values. ");
MGCAddSnippet(24, "You can use a DFM Function statement to simplify coding of traditional bucketed rules, such as those typically used for wide metal spacing checks.");
MGCAddSnippet(25, "The two rule checks in this section measure the path lengths of nets connected to MOS gates on the first two layers of metal interconnect. ");
MGCAddSnippet(26, "This check measures the path lengths of nets connected to MOS gates on the first two layers of metal interconnect. An effective length of each polygon in the path is estimated using an equation.");
MGCAddSnippet(27, "This check measures the path lengths of nets connected to MOS gates along centerlines of complete polygons on the first two layers of metal interconnect. Length is not measured from via to via or via to contact, but along the entire lengths of polygons. Corners and jogs are handled reasonably so lengths are not counted twice at corners.");
MGCAddSnippet(28, "The path length of polygons in a net can be computed by two different methods: centerline method and effective length method. ");
MGCAddSnippet(29, "This example checks the width, length, and length to width ratio rules for an unsilicided resistor. Results, with attached properties, are only output for resistors that fail at least one of the rules. ");
MGCAddSnippet(30, "This section includes grid and pitch checks.");
MGCAddSnippet(31, "You can check that polygon centerlines are aligned, where one polygon, such as a marker shape, overlaps another polygon from a different layer.");
MGCAddSnippet(32, "You can identify active area (AA) regions where gates are not equally spaced apart, have unequal widths, or both.");
MGCAddSnippet(33, "You can check that the centerline-to-centerline spacing of gates within the same active area are spaced with an integer pitch value relative to each other.");
MGCAddSnippet(34, "You can check that the centerline-to-centerline spacing of routing wires are spaced with an integer multiple of the pitch value relative to each other. ");
MGCAddSnippet(35, "You can check that the center points of contacts within an optical radius are spaced with an integer pitch value relative to each other. ");
MGCAddSnippet(36, "This section includes miscellaneous advanced DRC checks.");
MGCAddSnippet(37, "A dangling wire is defined as a segment of metal that connects to one or more vias at one end and is unconnected at the other end. ");
MGCAddSnippet(38, "You can use a DFM Circle Analyze or Inside Cell CIRCLE operation to find approximately circular shapes in a layout. ");
MGCAddSnippet(39, "You can find length and width edges of any rectangle. Length edges are defined as the longer edges and width edges are the shorter edges. You can also identify squares and output one of the edges. ");
MGCAddSnippet(40, "You can identify edges of pads that are closest to the chip edge using marker polygons. This check can be useful for determining which way pads should be oriented. ");
MGCAddSnippet(41, "You can find the number of rows and columns in an array of shapes using a DFM Property operation. The values are attached to the output layer as DFM properties. The number of shapes in each row and column is also determined.");
MGCAddSnippet(42, "In certain cases, polygons on a layout can be arranged in such a way that finding their extents cannot be done using a single Extents operation. ");
MGCAddSnippet(43, "You can use DFM Property and DFM Classify to output only unique violations from a set of DRC violations. The example constructs error marker polygons using an External operation. The rule check outputs only one error marker from a set of redundant violations. The redundant violations occur when more than one spacing violation occurs between the same two polygons. This is useful for reducing the number of DRC results. ");
MGCAddSnippet(44, "You can use eqDRC and the DFM Size operation to resize polygons by a percentage of their area. ");
MGCAddSnippet(45, "Chip-level verification for recent design nodes has become steadily more complex and time-consuming. DRC results counts have increased geometrically and LVS errors are difficult to debug. The Calibre chip-level verification tools provide a way to run quick turn-around verification at an early stage in the design process. Finding and fixing errors at an early stage in the design process can shorten the overall physical verification time. ");
MGCAddSnippet(46, "Run Calibre nmDRC Reconnaissance mode to automatically execute a subset of rule checks in a rule file.");
MGCAddSnippet(47, "By default, Calibre nmDRC Recon automatically enables a set of rule checks that run fast and are not context-dependent. You can customize the checks that are run, depending on where you are in the design cycle. ");
MGCAddSnippet(48, "Run Calibre DRC Analyze to get error distribution results data for gross analysis of areas of a design that require attention.");
MGCAddSnippet(49, "Calibre RVE for DFM is used to access the DRC Analyze results. The functionality is similar to that in a DFM Report Card. The main difference is, DFM Analyze data is concerned with rule check results counts and not other statistics in a DFM Report Card.");
MGCAddSnippet(50, "Calibre RVE for DFM allows review of DRC Analyze results. The presentation is similar to DFM Report Card and Density RDB results. This topic shows some of the more commonly used features.");
MGCAddSnippet(51, "Calibre nmLVS Recon SI performs stand-alone short isolation independent of an LVS run. Such runs are typically very fast and can be used early in the design verification process to avoid various problems in later LVS runs. ");
MGCAddSnippet(52, "Calibre nmLVS Recon Softchk performs stand-alone Sconnect stamping conflict (soft connection) checks independent of an LVS run. This permits conducting these checks in parallel with things like stand-alone short isolation. ");
MGCAddSnippet(53, "The Density operation is typically used for checking the ratio of a layer s area per unit area of a chip design. This chapter focuses on recommended ways to implement Density checks and analyze their output. ");
MGCAddSnippet(54, "Visualizing Density results using Calibre RVE is important for interpreting what they mean and how to fix them. Results visualization also assists you in writing better Density checks by providing properties that can be sorted, highlighted in color maps and histograms, and displayed in the layout itself.");
MGCAddSnippet(55, "This section presents typical Density checks.");
MGCAddSnippet(56, "The following procedure demonstrates how to perform density checking outside of a cell by using an exclusion layer.");
MGCAddSnippet(57, "The following procedure shows Density operations for checking polygons from one layer that are inside of another layer. The operation has an INSIDE OF LAYER option, but its performance can be slow in certain situations, so it is best to avoid using that option.");
MGCAddSnippet(58, "If you want to exclude a placed cell from density checking, but you want to check inside of a boundary layer at the same time, this procedure shows an optimized method. ");
MGCAddSnippet(59, "This procedure shows how to use the Density COMBINE option together with Calibre RVE.");
MGCAddSnippet(60, "In general, the use of Density INSIDE OF LAYER option is discouraged for performance reasons. Using the other methods shown in this chapter is preferred for most situations. However, if you choose to use INSIDE OF LAYER, this section discusses the main variants of this option.");
MGCAddSnippet(61, "This chapter discusses management of empty layers including how to assign them, how to find them, and how to ignore them.");
MGCAddSnippet(62, "An empty layer can be specified in the rule file. ");
MGCAddSnippet(63, "Empty layers can be derived in the rules. The following examples show the three possible derived layer types.");
MGCAddSnippet(64, "In certain situations, it is desirable to check if a particular layer is empty.");
MGCAddSnippet(65, "Layout magnification occurs in two ways: scaling the data by adjusting precision values (that is, changing the distance represented by a database unit) and using magnification factors to expand or shrink layout data. These are related effects and have aggregate outcomes.");
MGCAddSnippet(66, "Layout data uses a discrete coordinate system. There is a smallest unit of distance in a layout (called a database unit or dbu) that is indivisible. In other words, there is no infinitesimal approach (as in the real number system) to a given point in a layout.");
MGCAddSnippet(67, "At runtime, the layout database is converted to a Calibre database in memory. Calibre loads the layout database and keeps the number of grid points between two vertices the same. However, the distance between grid points may or may not be the same as the layout. If the distances are different, then scaling of the data occurs in the Calibre database. Additionally, magnification record values in the layout, as well as magnification factors specified in the rule file, are applied to the Calibre database. ");
MGCAddSnippet(68, "Certain rule file specification statements govern how magnification is performed for input or output. ");
MGCAddSnippet(69, "Physical precision, rule file precision, and magnification are interrelated. This section discusses some useful formulas for computing scaling and magnification factors. It also discusses recommended practices for setting precision and magnification values.");
MGCAddSnippet(70, "Scaling is determined from the physical precision and the rule file precision. ");
MGCAddSnippet(71, "When data is read into Calibre, layout database coordinates (dbu) are divided by the Precision statement value, and the resulting coordinate values are used in the Calibre database. If the Precision value and the Layout Precision value (reciprocal of the physical precision) are different, then scaling occurs. ");
MGCAddSnippet(72, "When generating mask data output and using magnification values less than 1, it is recommended to increase your measurement precision. ");
MGCAddSnippet(73, "Sometimes it is desirable to increase the measurement precision beyond the physical precision of the layout. This is used for DRC runs where a smaller measurement grid is desired than what the layout has inherently.");
MGCAddSnippet(74, "It is desirable to reduce layout magnification (shrinking the layout) without causing problems due to grid snapping. This is accomplished by increasing the precision.");
MGCAddSnippet(75, "A degenerate boundary (GDS) or polygon (OASISOASIS is a registered trademark of Thomas Grebinski and licensed for use to SEMI, San Jose. SEMI is a registered trademark of Semiconductor Equipment and Materials International.) is a record in a layout database that represents a malformed shape. ");
MGCAddSnippet(76, "This chapter identifies SVRF and Litho commands that are sensitive to rotation. ");
MGCAddSnippet(77, "Some SVRF statements are sensitive to rotation in general while others are sensitive to potential grid snapping induced by rotation.");
MGCAddSnippet(78, "This section lists the Litho commands that are sensitive to rotation in general. These are not used in physical verification flows but are covered here for completeness.");
MGCAddSnippet(79, "Regression testing is employed to verify tool behaviors across software versions, to benchmark rule file performance, to compare layout versions, and so forth. This testing ensures consistency of mask generation across variable factors of the design process. Constructing a robust regression flow is therefore a common concern.");
MGCAddSnippet(80, "Calibre DESIGNrev can use Tcl scripts in batch mode to generate layout databases and information about layout databases. This procedure discusses a script that creates an OASIS layout from a current layout database, a golden DRC results database, and a regression DRC results database. The script also generates an XOR comparison rule file that compares the results in the two input results databases by basing the compared layer names on the names of rule checks. This is useful in a DRC regression flow where the layout and rule file can change, while the rule check names remain the same.");
MGCAddSnippet(81, "Pattern matching has applications in layout analysis and layout manipulation. You can also classify results by pattern geometry.");
MGCAddSnippet(82, "You can easily capture a pattern from a layout using the Calibre Pattern Matching GUI. This procedure uses the drawn rectangle mode to capture a pattern that is used in the next two procedures in this chapter. ");
MGCAddSnippet(83, "You can use pattern matching to identify a problem area in a layout and fix the problem by adding layout shapes. ");
MGCAddSnippet(84, "You can add constraints to a pattern to allow for variations in edge location. You can also constrain an output marker to be a fixed distance from a pattern edge that has constraints. ");
MGCAddSnippet(85, "DBCLASSIFY is an obsolete layer operation that was used in some RET flows to classify errors (or patterns) by shape. DFM Pattern Classify can also classify error locations. ");
MGCAddSnippet(86, "HTML reporting in Calibre RVE for DRC creates HTML pages corresponding to views in Calibre RVE. You can specify views of DRC result tables, result highlights, histograms, and colormaps. Controls are included for grouping, filtering, and sorting the results, and for customizing the report format.");
MGCAddSnippet(87, "The following example demonstrates using DRC HTML reporting to generate a report for a DRC waiver run. The report is used to document the errors that remain in the design and the waivers that were applied.");
MGCAddSnippet(88, "The following example shows a DRC HTML report created for a Calibre PERC LDL CD results database. ");
MGCAddSnippet(89, "The following example shows a DRC HTML report created for Calibre LFD (Litho Friendly Design) results. ");
MGCAddSnippet(90, "There are a number of methods for determining device counts that employ various Calibre tools. These counts can be determined from the source design using Calibre PERC, and from the layout design in your DRC or LVS flow. Calibre Query Server can provide the counts after LVS has been run.");
MGCAddSnippet(91, "You can obtain flat device counts from DRC-style rule checks. Flat counts include physical, non-reduced devices.");
MGCAddSnippet(92, "Flat device counts can be obtained from a circuit extraction run through ERC checks, the circuit extraction report, the Query Server, or Calibre PERC rule checks.");
MGCAddSnippet(93, "Many Electrical Rule Check (ERC) problems can be solved using Calibre PERC. Detection of ERC problems includes Electrostatic Discharge (ESD) checks, Electrical Overstress (EOS) checks, multiple power domain crossing checks, voltage dependency checks, point-to-point current density and resistance checks, among other circuit reliability verification checks. It is advantageous to check for ERC issues in your source netlist to prevent problems in the layout and in the manufactured design. Most of these checks can also be performed on a layout netlist. Checks requiring parasitic resistance information can only be performed on the layout.");
MGCAddSnippet(94, "A common best practice is for the bulk terminals of MOS devices to be connected to voltage sources. PMOS bulk pins should be connected to power and NMOS bulk pins to ground.");
MGCAddSnippet(95, "In cases where multiple power domains are present, a given MOSFET s terminals often should not be connected to different power domains, unless the device is located inside a level shifter cell.");
MGCAddSnippet(96, "In cases where multiple ground domains are present, signal lines that cross ground domains require back-to-back diode protection.");
MGCAddSnippet(97, "ESD devices are frequently required to prevent damage due to voltage accumulation across I/O pads.");
MGCAddSnippet(98, "Resistors are frequently used to protect gates tied directly to power or ground. ");
MGCAddSnippet(99, "Frequently it is desirable to check device pins to determine whether proper voltages exist for certain test vectors. For example, if a certain voltage exists on the gate pin, then the differences in voltages between gate and source, gate and drain, and source and drain must be within certain tolerances.");
MGCAddSnippet(100, "In certain flows, it is desirable to calculate current density and interconnect resistivity for ESD and other types of checking. Current density and resistance is calculated between specified pins, or between ports and pins.");
MGCAddSnippet(101, "There are a number of best practices to consider when using Calibre nmLVS, including rule file elements you should use, and rule file practices you should avoid.");
MGCAddSnippet(102, "LVS in Calibre is performed in two primary phases: circuit extraction and circuit comparison. Performing circuit extraction depends upon your rule file containing the appropriate layer derivations, connectivity extraction statements, text recognition statements, and device recognition statements. Hence, considerable rule file setup is required to perform circuit extraction, some of which may be performed by your foundry.");
MGCAddSnippet(103, "The following table shows rule file elements that should be avoided in most circumstances.");
MGCAddSnippet(104, "If you are using a digital place and route (P&R) flow, the following guidelines pertain to selection of hcells. ");
MGCAddSnippet(105, "In general, you should only extract device properties only when they are required. In LVS, that means you generally do not want to extract and compare properties used for parasitic extraction and post-layout simulation.");
MGCAddSnippet(106, "Many device properties are used in post-layout simulation but are not used in regular LVS debugging. Many of these properties are costly to extract in terms of LVS run time and memory consumption. ");
MGCAddSnippet(107, "Local property measurements use seed layer declarations in Device property computation language function calls. A local measurement can use a seed layer, or a seed layer and a pin layer (the pin layer may be referenced by layer name or pin name), or a seed layer and an auxiliary layer. Using seed layers in function calls extracts the device properties in the immediate context of the device seed shapes; hence, the measurements are local. ");
MGCAddSnippet(108, "LVS Box is a rule file specification statement used to prevent the contents of cells from being compared in LVS-H verification. It is also used to exclude cell contents during circuit extraction. Typically cells that are incomplete in the layout, source, or both are specified to prevent spurious discrepancies. There are three flows: black box, gray box, and regular box. Each of these has a preferred usage model, which is important to understand when selecting a box cell flow.");
MGCAddSnippet(109, "In certain cases, it can be desirable to concentrate on performing layout short isolation over other circuit extraction tasks. With the appropriate rule file configuration and knowledge of Query Server commands, it can be faster to perform short isolation as discussed in this section.");
MGCAddSnippet(110, "A basic LVS rule file template is included. Modify it as necessary for your run.");
MGCAddSnippet(111, "Foundry-provided rule files often use conditional statements to select the portions of the rule file that are executed. The conditional statements can be controlled by environment variables or with #DEFINE statements in the rule file. Variables are also used in the rule file to set certain numerical and string parameters. ");
MGCAddSnippet(112, "You can add custom menu items to the Calibre integration menu for supported design tools. The custom menu item can be defined to call any valid shell script or command and environment variables can be defined for the execution environment. ");
MGCAddSnippet(113, "You can use Calibre Interactive to set the environment variables that are in effect for the Calibre run and save those settings to a runset. Environment variables defined in the runset take precedence over environment variables set in the shell environment. ");
MGCAddSnippet(114, "You can use the Customization GUI in Calibre Interactive to place #DEFINE and #UNDEFINE pre-processor directives and variable definitions in the rule file. The customization GUI is a dialog box with user-coded controls which place statements in the Calibre Interactive control file. ");
MGCAddSnippet(115, "This example demonstrates using the Calibre Interactive Customization GUI to place a #DEFINE pre-processor directive in the control file. A shell environment value is read to determine the initial value of the #DEFINE directive. ");
MGCAddSnippet(116, "This example demonstrates how to read the value of a shell environment variable using the Calibre Interactive Customization GUI and insert a #DEFINE with that value into the Calibre Interactive control file. ");
MGCAddSnippet(117, "You can use the customization GUI to insert a Variable statement in the Calibre Interactive control file. The following example reads the environment variable METAL_WIDTH from the shell and uses the value in a Variable statement. ");
MGCAddSnippet(118, "Some form of pre- or post-processing is often performed with a Calibre run. For example, pre-processing can prepare a layout or netlist for verification or construct an input file. Post-processing can prepare or analyze report files. There are several methods for automatically executing a pre- or post-processing procedure or script with your Calibre run. The method you choose depends on your design environment and the execution environment for the pre- or post-processing procedure.");
MGCAddSnippet(119, "You can define a custom menu command for Cadence Virtuoso to first call a SKILL function, then execute one or more commands. This example demonstrates how to create a custom menu item that calls a SKILL procedure, runs Calibre Interactive in batch mode, then executes a shell command for post-processing.");
MGCAddSnippet(120, "You can use Calibre Interactive to specify a trigger function that runs just before the Calibre run starts. This example defines a trigger function to process the source netlist. The Calibre Interactive internal trigger runs after source and layout export completes and before the Calibre nmLVS run starts. ");
MGCAddSnippet(121, "Details on open source and third-party software that may be included with this product are available in the <your_software_installation_location>/legal directory.");

